def removeHDFSFileOutputCommitterFiles (full_outputpath, extension):
  files = mssparkutils.fs.ls(full_outputpath)
  files_to_rm = [f.path for f in files if f.path[-3:] != extension]
  for file in files_to_rm:
    mssparkutils.fs.rm(file)

def run_with_retry(notebook, timeout, max_retries = 3):
  num_retries = 0
  while True:
    try:
      return mssparkutils.notebook.run(notebook, timeout)
    except Exception as e:
      if num_retries > max_retries:
        raise e
      else:
        print ("Retrying error", e)
        num_retries += 1
